import React from "react";
import styled from "styled-components";

export default function Content() {
  return (
    <ContentContainer>
      <div>
        <button></button>
      </div>
    </ContentContainer>
  );
}

const ContentContainer = styled.content`
  button {
    width: 40px;
    height: 40px;
  }
`;
